INSERT INTO `payrollProcedure` (`id`, `name`, `code`, `createdBy`, `modifiedBy`, `createdAt`, `modifiedAt`, `revStatus`, `lock`) VALUES ('C-Antig-Inicio','ComÃºn - AntigÃ¼edad - InicializaciÃ³n','; ****** CALCULO DE ANTIGÃœEDAD ******\r\n; cÃ¡lculo de la antigÃ¼edad (comÃºn a nÃ³minas por dÃ­a y por hora)\r\n\r\n; El cÃ¡lculo de antigÃ¼edad sÃ³lo se aplica si alguna de estas constantes estÃ¡n definidas: BONANTIG, BONANTIG2, BONANTIG3, BONANTIG4, BONANTIG5, BONANTIGJC, BONANTIGTEX, BONANTIGPROG, BONANTIGMAR.\r\n;\r\n; *** 1- Base del cÃ¡lculo ***\r\n;\r\n; SÃ³lo aplicable a modalidad por horas:\r\n;\r\n; 	1a- Modalidad 1: Horas trabajadas\r\n; 	* Definir ANTIGBASEHORAS=1 o ANTIGBASEHORAS2=1\r\n; 	* Si ademÃ¡s se quiere sumar las horas de feriados definir ANTIGBASEHORASFER=horas-por-feriado\r\n;\r\n; 	1b- Modalidad 2: Salario por hora * 200\r\n; 	* Definir BONANTIGHS200=1\r\n;\r\n; 	1c- Modalidad 3: Salario por hora * x% por aÃ±o de antigÃ¼edad\r\n; 	* Definir BONANTIGPROG=x%\r\n;\r\n; 	1d- Modalidad 4: Salario proporcional a las horas trabajadas\r\n; 	* No definir ninguna de las constantes anteriores\r\n;\r\n; SÃ³lo aplicable a modalidad por dÃ­as:\r\n;\r\n; 	1a- Modalidad 1: Salario proporcional a los dÃ­as trabajados\r\n; 	* Es la Ãºnica modalidad en el caso de dÃ­as.\r\n;\r\n; Tanto para dÃ­as como horas:\r\n;\r\n; * Si se desea hacer la base proporcional al tipo de jornada (24hs, 32hs, 48hs, etc.), definir BONANTIGJC=1\r\n;\r\n; * Si se desear agregar un monto de presentismo fijo a la base definir PRESENTVALOR=x\r\n;\r\n; *** 2- % de antigÃ¼edad a aplicar ***\r\n;\r\n; 2a- Modalidad 1: se determina un % y el mismo se multiplica por los aÃ±os de antigÃ¼edad\r\n; 2a1- Modalidad CCT Textiles: el % se obtiene de una tabla\r\n; * Definir BONANTIGTEX=1\r\n; 2a2- Modalidad CCT Marroquineros: el % se obtiene de una tabla\r\n; * Definir BONANTIGMAR=1\r\n; 2a3- Modalidad % fijo: el % se obtiene de la cte\r\n; * Definir BONANTIG=x%, BONANTIG3=x% o BONANTIGJC=x%\r\n; NOTA: los aÃ±os de antigÃ¼edad no se aplican (es decir se usa sÃ³lo el %) si se define ANTIGBASEHORAS\r\n;\r\n; 2b- Modalidad 2: se utilizar un % fijo sin considerar los aÃ±os de antigÃ¼edad\r\n; * Definir BONANTIG2=x%\r\n;\r\n; 2c- Modalidad 3: Salario por hora * x% por aÃ±o de antigÃ¼edad\r\n; * Definir BONANTIGPROG=x%\r\n;\r\n; 2d - Modalidad BONANTIG4: se aplica 1% por aÃ±o de antigÃ¼edad pero a partir del 2do aÃ±o\r\n;\r\n; 2e - Modalidad BONANTIG5: se aplica un monto fijo (BONANTIG5) por los aÃ±os de antigÃ¼edad y se descarta la base.\r\n\r\n; * Si se desea agregar un % base (que se suma el % calculado) definir dicho valor en ANTIGBASE\r\n\r\nSI (@BONANTIG5)\r\n	@temp = 0\r\n	@antg = @BONANTIG5\r\n	@antgbase = @antiguedad\r\n;	CANT 00501 : @antg\r\nFINSI\r\n\r\nSI (@temp) & (@BONANTIGJC)\r\n	@antgbase = @antgbase * @brutocontribp\r\nFINSI\r\n\r\n; utilizar esquema de CCT Textiles (sÃ³lo para salario por dÃ­a)\r\nSI (@BONANTIGTEX) & (\"@TIPOSALARIO\" = \"D\")\r\n	@temp = 0\r\n	@antg = 0\r\n	SI @antiguedad >= 2\r\n		@antg = 4%\r\n	FINSI\r\n	SI @antiguedad >= 3\r\n		@antg = 8%\r\n	FINSI\r\n	SI @antiguedad >= 5\r\n		@antg = 10%\r\n	FINSI\r\n	SI @antiguedad >= 8\r\n		@antg = 14%\r\n	FINSI\r\n	SI @antiguedad >= 10\r\n		@antg = 16%\r\n	FINSI\r\n	SI @antiguedad >= 15\r\n		@antg = 18%\r\n	FINSI\r\n	SI @antiguedad >= 20\r\n		@antg = 20%\r\n	FINSI\r\n	SI @antiguedad >= 25\r\n		@antg = 22%\r\n	FINSI\r\n	SI @antiguedad >= 30\r\n		@antg = 25%\r\n	FINSI\r\n	SI @antiguedad >= 35\r\n		@antg = 28%\r\n	FINSI\r\n	SI @antiguedad >= 40\r\n		@antg = 35%\r\n	FINSI\r\n;	CANT 00501 : @antg * 100\r\nFINSI\r\n\r\n; utilizar esquema de CCT Marroquineros\r\nSI (@temp) & (@BONANTIGMAR)\r\n	@temp = 0\r\n	@antg = 0\r\n	SI @antiguedad >= 1\r\n		@antg = 1%\r\n	FINSI\r\n	SI @antiguedad >= 3\r\n		@antg = 3%\r\n	FINSI\r\n	SI @antiguedad >= 6\r\n		@antg = 5%\r\n	FINSI\r\n	SI @antiguedad >= 8\r\n		@antg = 8%\r\n	FINSI\r\n	SI @antiguedad >= 10\r\n		@antg = 10%\r\n	FINSI\r\n	SI @antiguedad >= 13\r\n		@antg = 12%\r\n	FINSI\r\n;	CANT 00501 : @antg * 100\r\nFINSI\r\n\r\n; por % del salario\r\nSI @temp\r\n	; modalidad que calcula en funciÃ³n del prop. de horas\r\n	SI (@BONANTIGJC)\r\n		@antg = @BONANTIGJC\r\n	; modalidad que no usa el prop. de horas\r\n	SINO\r\n		SI @BONANTIG3\r\n			@antg = @BONANTIG3\r\n		SINO\r\n			SI @BONANTIG2\r\n				@antg = @BONANTIG2\r\n			SINO\r\n				SI @BONANTIG4\r\n					SI @antiguedad > 1\r\n						@antg = @antiguedad - 1\r\n					FINSI\r\n				SINO\r\n					@antg = @BONANTIG\r\n				FINSI\r\n			FINSI\r\n		FINSI\r\n	FINSI\r\n;	CANT 00501 : @antg * 100\r\n	; aplico la antigÃ¼edad (salvo si la base es las horas)\r\n	SI (! @ANTIGBASEHORAS) & (! @BONANTIG4)\r\n		@antg = @antg * @antiguedad\r\n	FINSI\r\n	; sumar a la antiguedad la base (si estÃ¡ definido)\r\n	SI (@ANTIGBASE)\r\n		@antg = @antg + @ANTIGBASE\r\n	FINSI\r\nFINSI\r\n\r\n; incluimos el presentismo fijo a la base de la antigÃ¼edad\r\nSI @PRESENTVALOR\r\n	@antgbase = @antgbase + @PRESENTVALOR\r\nFINSI\r\n\r\n; agregamos a la base asientos manuales\r\nSI (@ANTIGEXTRA) | (@ANTIGEXTRA2)\r\n	@antgbase = @antgbase + @manual_00005\r\nFINSI\r\n\r\n; calculamos el monto\r\n@antgmonto = @antg * @antgbase\r\n\r\nSI @VACAHSANTIG\r\n	@antgmonto = @antgmonto / 200 * @PERPORMES * @totalpreshoras\r\nFINSI\r\n	\r\nCANT 00501 : @antiguedad','deterplus','poly','2016-05-28 02:28:08',NULL,'VALIDATING',0),('C-AsigHijo','AsignaciÃ³n por hijo','; ****** ASIGNACION POR HIJO ******\r\n\r\n; Procedimiento para calular la asignaciÃ³n por hijo\r\n\r\n; lo calculo al final porque necesito saber el neto del recibo\r\n; el monto lo guardo en la variable @asigporhijo, por defecto lo pongo 0\r\n@asigporhijo = 0;\r\n; para calcular el valor de la asignacion me fijo en el neto\r\nSI @neto <= 50000\r\n	@asigporhijo = 100\r\nFINSI\r\nSI @neto <= 15000\r\n	@asigporhijo = 172\r\nFINSI\r\nSI @neto <= 12700\r\n	@asigporhijo = 338\r\nFINSI\r\nSI @neto <= 9800\r\n	@asigporhijo = 562\r\nFINSI\r\nSI @neto <= 7500\r\n	@asigporhijo = 837\r\nFINSI\r\n; asigno sÃ³lo si este mes aplica\r\nSI @asigporhijo\r\n	; @hijos tiene la cant. de hijos\r\n	CANT 40000 : @hijos\r\n	NOREN 40000 : @hijos * @asigporhijo\r\nFINSI','medina','A005','2016-06-02 18:42:12',NULL,'VALIDATING',0),('C-Desc-Bruto','ComÃºn - Descuentos - Sobre el bruto','; ****** CONCEPTOS DE DESCUENTO: DESCUENTOS SOBRE EL BRUTO ******\r\n; cÃ¡lculo de todos los descuentos que se aplican sobre el bruto\r\n\r\n; base de los descuentos\r\nSI @BASELEYSAC\r\n	@base = @valor_04008\r\nSINO\r\n	@base = @bruto\r\nFINSI\r\n\r\n; excluimos las licencias de la base de los conceptos de descuentos\r\nSI @LICNOAPORTA\r\n	@base = @base - @totlic\r\nFINSI\r\n\r\n; FAECYS: sÃ³lo aplico asi el CCT tiene FAECYS\r\n@temp = @FAECYS * @base\r\nSI @temp\r\n	GUARDAR FAECYS : @temp\r\n	CANT 25004 : @FAECYS * 100\r\n	DESC 25004 : @temp\r\nFINSI\r\n\r\n; Subsidio por Fallecimiento\r\nSI @SUBSIDIOFALL\r\n	CANT 25026 : @SUBSIDIOFALL * 100\r\n	DESC 25026 : @SUBSIDIOFALL * @base\r\nFINSI\r\n\r\n; Aporte Mutual\r\nSI @APOMUTUAL\r\n	CANT 25028 : @APOMUTUAL * 100\r\n	DESC 25028 : @APOMUTUAL * @base\r\nFINSI\r\n\r\n; Aporte sindical\r\nSI @APOCAPYACCIONSOC\r\n	CANT 25029 : @APOCAPYACCIONSOC * 100\r\n	DESC 25029 : @APOCAPYACCIONSOC * @base\r\nFINSI\r\n\r\n; Aporte sindical\r\n; Aplico cuota sindical si el empleado estÃ¡ afiliado y si el CCT tiene cuota\r\n@temp = @SINCUOTA * @base\r\nSI @afiliado & @temp\r\n	GUARDAR SINCUOTA : @temp\r\n	CANT 25003 : @SINCUOTA * 100\r\n	DESC 25003 : @temp\r\n; si no aplico cuota, me fijo si aplica el aporte solidario\r\nSINO\r\n	@temp = @SINAPSOLID * @base\r\n	SI @temp\r\n		GUARDAR SINAPSOLID : @temp\r\n		CANT 25005 : @SINAPSOLID * 100\r\n		DESC 25005 : @temp\r\n	FINSI\r\nFINSI\r\n\r\n; Seguro de Vida y Sepelio\r\n@temp = @APSEGVIDAYSEP * @base\r\nSI @temp\r\n	CANT 25015 : @APSEGVIDAYSEP * 100\r\n	DESC 25015 : @temp\r\n	GUARDAR APSEGVIDAYSEP : @temp\r\nSINO\r\n	DESC 25015 : @SEGVIDAYSEP\r\nFINSI','deterplus','lacuadra','2016-05-28 02:24:11',NULL,'VALIDATING',0),('C-Desc-Ley','ComÃºn - Descuentos - Por ley','; ****** CONCEPTOS DE DESCUENTO: DESCUENTOS POR LEY ******\r\n; cÃ¡lculo de todos los descuentos por ley\r\n\r\n; ----- Descuentos que NO aplican a directivos (LRT)\r\n\r\n; determinar si es LRT (directivo)\r\nSI \"@contratacion\" = \"99\"\r\n	@lrt = 1\r\nSINO\r\n	@lrt = 0\r\nFINSI\r\n\r\n; utilizar sÃ³lo el SAC como base para los descuentos por ley\r\nSI @BASELEYSAC\r\n	@BASEOBSOC = @valor_04008 * @brutocontribp\r\n	@aportes = @valor_04008\r\nFINSI\r\n\r\n; excluimos las licencias de la base de los conceptos de aportes\r\nSI @LICNOAPORTA\r\n	@aportes = @aportes - @totlic\r\nFINSI\r\n\r\n; Obra social: @OBSOCIAL es el % de la obra social\r\nSI (! @lrt) | (@LRTOS)\r\n\r\n	@obrasocialf = @OBSOCIAL\r\n\r\n	SI @BASEOBSOC\r\n		@temp = @BASEOBSOC	\r\n		; el base es la remun. 4 y 8\r\n		@remimp4 = @BASEOBSOC\r\n	SINO\r\n		SI @BASEJORNADA2\r\n			@maxhoras = @BASEJORNADA2\r\n		SINO\r\n			@maxhoras = 176\r\n		FINSI\r\n		SI (\"@TIPOSALARIO\" = \"H\") & (@totalpreshoras < @maxhoras) & (@jornadas > 15) & (! @OBSOCIALNO2)\r\n			SI @totalpreshoras\r\n				@temp = @aportes * @maxhoras / @totalpreshoras\r\n			SINO\r\n				@temp = 0\r\n			FINSI\r\n			;@temp = @salario * @maxhoras * (1 + @totpresentismocant)\r\n		SINO\r\n			;SI (@tipojornada < @basehoras)\r\n			;	@temp = @brutoosjorred\r\n			;SINO\r\n				@temp = @aportes\r\n			;FINSI\r\n		FINSI\r\n		SI @BASEOSSICOSS\r\n			@obrasocialf = @obrasocialf * @BASEOSSICOSS\r\n		SINO\r\n			@obrasocialf = @obrasocialf * @brutocontribp\r\n		FINSI\r\n		; el base es la remun. 4 y 8\r\n		@remimp4 = @temp * @brutocontribp\r\n	FINSI\r\n	; para el caso de ingreso o terminaciÃ³n recalcular al proporcional de dias\r\n	@temp1 = (\"@TIPOSALARIO\" = \"H\") | (@tipojornada < @basehoras)\r\n	@temp2 = (@peringreso) & (@diaingreso > 1) & (@diaingreso < 30)\r\n	@temp3 = (\"@terminacion\" != \"0\") & (@diaterm > 1) & (@diaterm < 30)\r\n	SI (@temp1) & (@temp2 | @temp3)\r\n		SI @temp2\r\n			@obrasocialp = 30 - @diaingreso + 1\r\n		SINO\r\n			@obrasocialp = @diaterm\r\n		FINSI\r\n		@obrasocialp = @obrasocialp / 30\r\n		;@temp = @temp * @obrasocialp\r\n		@remimp4 = @remimp4 * @obrasocialp\r\n	FINSI\r\n	; guardo para reporte\r\n	GUARDAR OBRASOCIALAP : @remimp4\r\n	@temp = @temp * @obrasocialf\r\n	@obrasocial = 25002\r\n	CANT 25002 : @OBSOCIAL * 100\r\n	DESC 25002 : @temp\r\n	; guardo para reporte\r\n	GUARDAR OBRASOCIAL : @temp\r\n\r\nFINSI\r\n\r\nSI ! @lrt\r\n\r\n	; Aporte jubilatorio: @APJUB es el % del aporte jubilatorio\r\n	; lo aplico sobre el total de aportes\r\n	@temp = @APJUB * @aportes\r\n	CANT 25101 : @APJUB * 100\r\n	DESC 25101 : @temp\r\n	; guardo para reporte\r\n	GUARDAR APJUB : @temp\r\n\r\n	; Ley 19.032: @L19032 es el % de la Ley 19.032\r\n	@temp = @L19032 * @aportes\r\n	CANT 25001 : @L19032 * 100\r\n	DESC 25001 : @temp\r\n	; guardo para reporte\r\n	GUARDAR L19032 : @temp\r\n\r\nFINSI\r\n\r\n; ----- Descuentos sindicales\r\n\r\n; Cuota Sindical STIPA\r\n@temp = @CONTSINCUO * @aportes\r\nSI @temp\r\n	CANT 25012 : @CONTSINCUO * 100\r\n	DESC 25012 : @temp\r\n	; guardo para reporte\r\n	GUARDAR CONTSINCUO : @temp\r\nFINSI\r\n\r\n; Cuota Gremial\r\n@temp = @CUOGREMIAL * @aportes\r\nSI @temp\r\n	CANT 25013 : @CUOGREMIAL * 100\r\n	DESC 25013 : @temp\r\n	; guardo para reporte\r\n	GUARDAR CUOGREMIAL : @temp\r\nFINSI\r\n\r\n; SEC (Art 100 CCT)\r\n@temp = @SEC * @aportes\r\nSI @temp\r\n	CANT 25014 : @SEC * 100\r\n	DESC 25014 : @temp\r\n	; guardo para reporte\r\n	GUARDAR SEC : @temp\r\nFINSI\r\n\r\n; Fondo Asistencia Social\r\n@temp = @APFONDSOCIAL * @aportes\r\nSI @temp\r\n	CANT 25017 : @APFONDSOCIAL * 100\r\n	DESC 25017 : @temp\r\nFINSI','deterplus','deterplus','2016-05-28 02:23:44',NULL,'VALIDATING',0),('C-Desc-Otros','ComÃºn - Descuentos - Otros','; ****** CONCEPTOS DE DESCUENTO: OTROS DESCUENTOS ******\r\n; cÃ¡lculo de otros descuentos\r\n\r\n; ----- Descuentos fijos\r\n\r\n; Aporte Adicional O.S.\r\nSI @APADICOS\r\n	DESC 25018 : @APADICOS\r\n	GUARDAR APADICOS : @APADICOS\r\nFINSI\r\n\r\n; ----- Para ganancias: Neto a Cobrar sin Ganancias\r\n\r\n; guardo el neto en una variable\r\n@gannetosingan = @neto\r\n\r\n; ----- Descuentos ingresados en el legajo\r\n\r\n; agregamos los descuentos ingresados en la pestaÃ±a del legajo para el perÃ­odo\r\nDESCUENTOS','deterplus','A005','2016-05-28 02:24:35',NULL,'VALIDATING',0),('C-Fin','ComÃºn - FinalizaciÃ³n','; ****** FINALIZACION ******\r\n; cÃ¡lculo finales de la nÃ³mina\r\n\r\n; ----- AsignaciÃ³n por hijo (desactivo por ahora)\r\n\r\n; INCLUIR C-AsigHijo\r\n\r\n; ----- CÃ¡lculo de ganancias\r\n\r\nSI (@CALCGANAN) & (! @manual_26000)\r\n	INCLUIR C-Ganancias\r\nFINSI\r\n\r\n; ----- TerminaciÃ³n\r\n\r\n; sÃ³lo aplico si el empleado no estÃ¡ activo\r\nSI \"@terminacion\" != \"0\"\r\n	INCLUIR C-Terminacion\r\nFINSI\r\n\r\n; ----- Conceptos exentos ingresados en el legajo\r\n\r\n; agregamos los conceptos exentos ingresados en la pestaÃ±a del legajo para el perÃ­odo\r\nEXENTOS','deterplus','dasier','2016-05-28 02:25:20',NULL,'VALIDATING',0),('C-Ganancias','CÃ¡lc. de ret. a las ganancias','; ****** CALCULO DE GANANCIAS ******\r\n\r\n; Procedimiento para calular retenciÃ³n de ganancias\r\n\r\n; --- Incluyo las tablas de deducciones\r\n\r\nINCLUIR C-Ganancias-Ded\r\n\r\n; --- Sueldo Neto Acumulado al Mes (NETOACUM)\r\n\r\n; leo el neto sin ganancias acum. del perÃ­odo anterior...\r\nSI @GANNETOACUM\r\n	@netoacumant = @GANNETOACUM\r\nSINO\r\n	@netoacumant = LEER(NETOACUM, 1)\r\nFINSI\r\n; ...y le sumo el neto sin ganancias de este mes (@gannetosingan)\r\n@netoacum = @netoacumant + @gannetosingan\r\nINFO Neto acumulado (Ganancias) : @netoacum\r\n; guardo el resultado para ser utilizado el prÃ³ximo perÃ­odo\r\nGUARDAR NETOACUM : @netoacum\r\n; guardo \"Neto a Cobrar sin Ganancias\" para reporte\r\nGUARDAR NETOSINGAN : @gannetosingan\r\n; guardo \"Sueldo Neto Anterior Acumulado\" para reporte\r\nGUARDAR NETOACUMANT : @netoacumant\r\n\r\n; --- Deducciones 1 (DED1)\r\n\r\n@ded1 = 0\r\n; proceso las deducciones especiales del tipo GANDED1\r\nPROCESAR ESPECIALES\r\n	SI \"@tipo\" = \"GANDED1\"\r\n		@ded1 = @ded1 + (@monto / 12 * @periodo)\r\n	FINSI\r\nFINPROCESAR\r\n; guardo \"Sub Total 1 Deducciones\" para reporte\r\nGUARDAR DED1 : @ded1\r\n\r\n; --- Ganancia Neta para Tope (GANTOPE)\r\n\r\n; = NETOACUM - DED1\r\n@gannetatope = @netoacum - @ded1\r\n; guardo \"Ganancia Neta para Tope 5 %\" para reporte\r\nGUARDAR GANTOPE : @gannetatope\r\n\r\n; --- Tope (TOPE)\r\n\r\n; = GANTOPE * 5%\r\n@tope = @gannetatope * 5%\r\n; guardo \"Ganancia Neta para Tope 5 %\" para reporte\r\nGUARDAR TOPE : @tope\r\n\r\n; --- Deducciones 2 (DED2)\r\n\r\n@ded2 = 0\r\n; proceso las deducciones especiales del tipo GANDED2\r\nPROCESAR ESPECIALES\r\n	SI \"@tipo\" = \"GANDED2\"\r\n		@ded2 = @ded2 + (@monto / 12 * @periodo)\r\n	FINSI\r\nFINPROCESAR\r\n; MÃ­nimo no imponible\r\n@dedx = @dedminnoimp * @periodo\r\nGUARDAR DED2A : @dedx\r\n@ded2 = @ded2 + @dedx\r\n; DeducciÃ³n especial\r\n@dedx = @dedespecial * @periodo\r\nGUARDAR DED2B : @dedx\r\n@ded2 = @ded2 + @dedx\r\n; CÃ³nyuge\r\nSI @conyuge\r\n	@dedx = @dedconyuge * @periodo\r\n	GUARDAR DED2C : @dedx\r\n	@ded2 = @ded2 + @dedx\r\nFINSI\r\n; Hijos\r\nSI @hijos\r\n	@dedx = @dedhijo * @periodo * @hijos\r\n	GUARDAR DED2D : @dedx\r\n	@ded2 = @ded2 + @dedx\r\nFINSI\r\n; Otras personas a cargo\r\n@otrasacargo = @familiares - @conyuge - @hijos\r\nSI @otrasacargo\r\n	@dedx = @dedotrascargas * @periodo * @otrasacargo\r\n	GUARDAR DED2E : @dedx\r\n	@ded2 = @ded2 + @dedx\r\nFINSI\r\n; guardo \"Sub Total 2 Deducciones\" para reporte\r\nGUARDAR DED2 : @ded2\r\n\r\n; --- Total deducciones (DED)\r\n\r\n@ded = @ded1 + @ded2\r\n; guardo \"Total Deducciones\" para reporte\r\nGUARDAR DED : @ded\r\n\r\n; --- Ganancia Neta Acumulada Imponible (NETOIMP)\r\n\r\n@netoimp = @netoacum - @ded\r\n; guardo \"Ganancia Neta Acumulada Imponible\" para reporte\r\nGUARDAR NETOIMP : @netoimp\r\n\r\n; --- Impuesto Determinado (IMPUESTO)\r\n\r\n; incluyo las tablas de impuesto fijo y 