 mes despido\r\n@brutoh = @TOTPAGOS\r\n; quitar adelantos y refrigerios\r\n@brutoh = @brutoh - @valor_25009 - @valor_04060 - @valor_04300\r\nGUARDAR BRUTO : @brutoh\r\n\r\n; para quincenas\r\nSI @PRIDIA = 1\r\n	; primer quincena guardo 0\r\n	GUARDAR BRUTOQ : 0\r\nSINO\r\n	; segunda quincena, al bruto de la primer quincena...\r\n	@temp = MAXIMO(BRUTO, 1)\r\n	; ...le sumo el de la sgunda quincena\r\n	@temp = @temp + @brutoh\r\n	GUARDAR BRUTOQ : @temp\r\nFINSI\r\n\r\n; ----- SAC y SAC proporcional\r\n\r\n; si estÃ¡ definida la cte EXSAC, entonces excluÃ­mos el SAC\r\nSI @EXSAC\r\n	@calcsac = 0\r\n; sino lo determinamos en funciÃ³n del perÃ­odo\r\nSINO\r\n	@calcsac = (@MES = 6) | (@MES = 12) | (\"@terminacion\" != \"0\")\r\nFINSI\r\n\r\n; calculo el SAC sÃ³lo los perÃ­odos 6 (junio) y 12 (diciembre)\r\nSI (@calcsac) | (@EXSAC)\r\n	@sac = 0\r\n	SI (\"@terminacion\" != \"0\") & (@diaterm < 31)\r\n		SI (@mesterm = 1) | (@mesterm = 7)\r\n			@sac = @brutoh / 12\r\n			@diastrabsem = @diaterm - 1\r\n		FINSI\r\n	FINSI\r\n	SI ! @sac\r\n		; periodos mensuales\r\n		SI @PERPORMES = 1\r\n			; determino el mÃ¡x. bruto de los 5 perÃ­odos anteriores\r\n			; esta funciÃ³n me devuelve el mÃ¡ximo de BRUTO de los Ãºltimos 5 perÃ­odos\r\n			@temp1 = \"@SEMDESDE\"\r\n			@temp2 = \"@PPERHASTA\"\r\n			@maxbruto = MAXIMO2(BRUTO, @temp1, @temp2)\r\n			; comparo dicho mÃ¡ximo con el bruto de este mes para determinar el mÃ¡x. del semestre\r\n			SI @brutoh > @maxbruto\r\n				@maxbruto = @brutoh\r\n			FINSI\r\n		SINO\r\n			; periodos quincenales\r\n			SI @PERPORMES = 2\r\n				; determino el mÃ¡x. bruto de las Ãºltimas 12 quincenas\r\n				@maxbruto = MAXIMO(BRUTOQ, 12)\r\n			; otros periodos (no soportado)\r\n			SINO\r\n				@maxbruto = 0\r\n			FINSI\r\n		FINSI\r\n		INFO Mejor Sueldo semestre (SAC) : @maxbruto\r\n		; calcular los dÃ­as a aplicar el SAC\r\n		SI (@MES = 1) | (@MES = 7)\r\n			@diastrabsem = 0\r\n		SINO\r\n			SI (@MES = 2) | (@MES = 8)\r\n				@temp = 1\r\n			FINSI\r\n			SI (@MES = 3) | (@MES = 9)\r\n				@temp = 2\r\n			FINSI\r\n			SI (@MES = 4) | (@MES = 10)\r\n				@temp = 3\r\n			FINSI\r\n			SI (@MES = 5) | (@MES = 11)\r\n				@temp = 4\r\n			FINSI\r\n			SI (@MES = 6) | (@MES = 12)\r\n				@temp = 5\r\n			FINSI\r\n			SI @PERPORMES > 1\r\n				@temp = @temp + 1\r\n			FINSI\r\n			@temp = @temp * @PERPORMES\r\n			INFO PerÃ­odos histÃ³ricos (SAC) : @temp\r\n			;SI @SACDIASNOSUM\r\n			;	@diastrabsem = SUMA(SACDIAST, @temp)\r\n			;SINO\r\n			@diastrabsem = SUMA2(SACDIAST, @temp)\r\n			;FINSI\r\n		FINSI\r\n		; y le sumo los dias trabajados en este perÃ­odo para tener la cantidad del semestre\r\n		; ademÃ¡s, agrego los dÃ­as de ajuste (si hubiera)\r\n		SI @PERPORMES = 1\r\n			@diastrabsem = @diastrabsem + @sacdiast\r\n		FINSI\r\n		@diastrabsem = @diastrabsem + @AJUSTESAC\r\n		INFO DÃ­as trabajados semestre (SAC) : @diastrabsem\r\n		; calculo el SAC\r\n		@temp = @maxbruto / 2 / 180\r\n		@sac = @temp * @diastrabsem\r\n		SI @AJUSTEMONTOSAC\r\n			@sac = @sac + @AJUSTEMONTOSAC\r\n		FINSI\r\n		; ajusto ciertas licencias agregando los dÃ­as de SAC\r\n		SI @valor_04010\r\n			@temp = @temp * @cantidad_04010\r\n			PAGO 04010 : @valor_04010 + @temp\r\n		FINSI\r\n	FINSI\r\n	SI @calcsac\r\n		; determino la cant. de perÃ­odos que tengo corridos anteriores al actual\r\n		; esta funciÃ³n cuenta la cantidad de registros que hay de BRUTO, como el BRUTO se registra con cada corrida, esto me da la cant. de corridas\r\n		@cantper = CONTAR(BRUTO)\r\n		; Ajuste SAC\r\n		SI @AJUSTEMONTOSAC\r\n			SI ! @valor_04018\r\n				CANT 04018 : @diastrabsem\r\n				PAGO 04018 : @sac\r\n			FINSI\r\n		SINO\r\n			; SAC proporcional\r\n			SI \"@terminacion\" != \"0\"\r\n				SI ! @valor_04003\r\n					CANT 04003 : @diastrabsem\r\n					PAGO 04003 : @sac\r\n				FINSI\r\n			SINO\r\n			; SAC\r\n				SI ! @valor_04008\r\n					CANT 04008 : @diastrabsem\r\n					PAGO 04008 : @sac\r\n				FINSI\r\n			FINSI\r\n		FINSI\r\n	FINSI\r\nFINSI\r\nAGREGAR HABSUJRET : 04008\r\nAGREGAR HABSUJRET : 04003\r\n\r\n; ----- Anticipo de sueldo\r\n\r\n; agregamos el dto del anticipo de sueldo\r\nPAGO 25010 : @valor_25009 * -1\r\nAGREGAR HABSUJRET : 25010\r\n\r\n; ----- Dto. dÃ­as no trabajados\r\n\r\n; sÃ³lo lo aplico si es un perÃ­odo de terminaciÃ³n y no trabajÃ³ completo\r\nSI (\"@terminacion\" != \"0\") & (@diaterm < 30)\r\n	@cant = 30 - @DIATERM + 1\r\n	@integrmes = @brutoh - @valor_00511\r\n	@integrmes = @integrmes / @jornadasmes * @cant\r\n	CANT 00010: @cant\r\n	PAGO 00010: @integrmes * -1\r\nFINSI\r\n\r\n; ----- Tope aportes\r\n\r\n; el total de pagos hasta aqui lo considero el tope de aportes para los desc. por ley\r\n@aportes = @TOTPAGOS\r\n; verifico que este valor no supere el tope por ley (TOPEDESCLEY)\r\nSI @aportes > @TOPEDESCLEY\r\n	@aportes = @TOPEDESCLEY\r\nFINSI\r\n\r\n; ----- CÃ¡lculo del bruto para las contribuciones\r\n\r\n; hasta acÃ¡ consideramos el bruto para las contribuciones\r\n@brutocontrib = @TOTPAGOS\r\n\r\n; ----- FinalizaciÃ³n\r\n\r\n; guardo el bruto en una variable para ser utilizado mÃ¡s adelante\r\n@bruto = @TOTPAGOS\r\n; guardo el total de variables para ser usado en otros perÃ­odos\r\nGUARDAR VARIABLE : @montovar\r\nINFO MONTO VARIABLE : @montovar','deterplus','manrique','2016-05-28 02:22:29',NULL,'VALIDATING',0),('C-Pagos-Viaticos','ComÃºn - Pagos - ViÃ¡ticos','; ****** CONCEPTOS DE PAGO: VIATICOS ******\r\n; cÃ¡lculo de viÃ¡ticos\r\n\r\n; cÃ¡lculo de dÃ­as para las modalidades 3\r\nSI (@VIATICO3) | (@COMIDA3)\r\n	SI \"@terminacion\" != \"0\" \r\n		@dias3 = @jortrab - 1\r\n	SINO\r\n		SI @peringreso\r\n			@dias3 = @jortrab\r\n		SINO\r\n			@dias3 = 24\r\n		FINSI\r\n	FINSI\r\nFINSI\r\n\r\n; ----- ViÃ¡ticos\r\n\r\n; Modalidad 1: se paga un fijo por dÃ­a efectivo trabajado (VIATICO1)\r\nSI @VIATICO1\r\n	@viaticoscant = @VIATICO1\r\n	@viaticos = @diasef * @VIATICO1\r\nFINSI\r\n\r\n; Modalidad 2: se establece un valor mensual (VIATICO2) segÃºn CCT que corresponde por 30 dÃ­as y se descuentan las ausencias injustificadas\r\nSI @VIATICO2\r\n	@viaticoscant = @VIATICO2\r\n	@viaticos = @VIATICO2 / 30 * (30 - @ausnojus)\r\nFINSI\r\n\r\n; Modalidad 3: se paga un fijo (VIATICO3) por 24 dÃ­as pero se descuentan estas ausencias: INJUTIF., LIC. SIN GOCE, MATERNIDAD, EXCEDENCIA\r\nSI @VIATICO3\r\n	@viaticoscant = @VIATICO3\r\n	;TODO: descontar las ausencias\r\n	@viaticos = @dias3 * @VIATICO3\r\nFINSI\r\n\r\n; Art 19 ViÃ¡ticos No Remunerativos\r\nSI @ART19\r\n	@viaticoscant = @ART19\r\n	@viaticos = @ART19\r\nFINSI\r\n\r\n; ----- Comidas\r\n\r\n; Modalidad 1: se paga un fijo por dÃ­a efectivo trabajado (COMIDA1)\r\nSI @COMIDA1\r\n	@comidascant = @COMIDA1\r\n	@comidas = @jortrab * @COMIDA1\r\nFINSI\r\n\r\n; Modalidad 2: se establece un valor mensual (COMIDA2) segÃºn CCT que corresponde por 30 dÃ­as y se descuentan las ausencias injustificadas\r\nSI @COMIDA2\r\n	@comidascant = @COMIDA2\r\n	@comidas = @COMIDA2 / 30 * (30 - @ausnojus)\r\nFINSI\r\n\r\n; Modalidad 3: se paga un fijo (COMIDA3) por 24 dÃ­as pero se descuentan estas ausencias: INJUTIF., LIC. SIN GOCE, MATERNIDAD, EXCEDENCIA\r\nSI @COMIDA3\r\n	@comidascant = @COMIDA3\r\n	;TODO: descontar las ausencias\r\n	@comidas = @dias3 * @COMIDA3\r\nFINSI','deterplus','castro','2016-05-28 02:22:51',NULL,'VALIDATING',0),('C-Pres','ComÃºn - Presentismo','; ****** CALCULO DEL PRESENTISMO ******\r\n; cÃ¡lculo del presentismo\r\n\r\n; ** Modalidad 1 - Se especifica un % (usa el salario como base)\r\n\r\n; SINPRES1=X%	: Mod. 1a: incluye antig.\r\n; SINPRES3=X%	: Mod. 1b: incluye feriados y lic. por enfermedad\r\n;	SINPRES4	: si vale 1 se usa como base el salario por dÃ­a (sÃ³lo para 1b)\r\n; SINPRES2=X%	: Mod. 1c: no incluye nada de lo anterior\r\n\r\n; ** Modalidad 2 - Se especifica un monto fijo de presentismo\r\n\r\n; PRESENTVALOR	: monto fijo a aplicar\r\n; PRESENTVALORP	: monto fijo a aplicar proporcional a los dÃ­as trabajados\r\n\r\n; ** Modalidad 3 - Se especifica un % y se calcula en prop. a los dias trabajados\r\n\r\n; SINPRES5=X%\r\n\r\n; ** CondiciÃ³n de puntos\r\n\r\n; SINPRESPTOSMAX: mÃ¡x. de puntos permitidos para aplicar presentismo\r\n; SINPRESPTOS	: puntos del legajo (debe ser menor <= SINPRESPTOSMAX para aplicar)\r\n\r\n; ** Adicional de presentismo perfecto\r\n\r\n; (sÃ³lo se aplica si no tiene ausencias injustificadas)\r\n\r\n; SINPRESPERF=X%	: considera los adicionales\r\n; SINPRESPERF3=X%	: NO considera los adicionales\r\n\r\nSI (@AUSNOJUS <= @SINPRESTOL) | (@SINPRES5)\r\n\r\n	@totpresentismo = 0\r\n	@totpresentismocant = 0\r\n\r\n	; presentismo\r\n	SI (@SINPRES1) | (@SINPRES2) | (@SINPRES3) | (@SINPRES5) | (@PRESENTVALOR) | (@PRESENTVALORP)\r\n		SI @SINPRESPTOSMAX\r\n			@ptosmax = @SINPRESPTOSMAX\r\n		SINO\r\n			@ptosmax = 1\r\n		FINSI\r\n		SI @SINPRESPTOS\r\n			@ptos = @SINPRESPTOS\r\n		SINO\r\n			@ptos = 1\r\n		FINSI\r\n		; sÃ³lo aplico presentismo si no supera los ptos mÃ¡x.\r\n		SI @ptos <= @ptosmax\r\n			; calculo el presentismo modalidad 1: % del salario\r\n			; sÃ³lo aplico este presentismo si el CCT tiene definida la constante SINPRES1 o SINPRES2 que indica que maneja esta modalidad\r\n			; aquÃ­ comienzo un bloque condicional, lo que estÃ¡ adentro sÃ³lo se aplica si la condiciÃ³n da positiva\r\n			SI (@SINPRES1) | (@SINPRES2) | (@SINPRES3)\r\n				SI @SINPRES1\r\n					@presentismofac = @SINPRES1\r\n				SINO\r\n					SI @SINPRES2\r\n						@presentismofac = @SINPRES2\r\n					SINO\r\n						@presentismofac = @SINPRES3\r\n					FINSI\r\n				FINSI\r\n				; el presentismo es entonces el % por el salario mensual\r\n				@presentismo = @presentismofac * @salarioprop\r\n				; en cantidad voy a poner el % aplicado\r\n				@presentismocant = @presentismofac\r\n			SINO\r\n				; calculo el presentismo modalidad 2: valor fijo\r\n				; sÃ³lo aplico este presentismo si el CCT tiene definida la constante PRESENTVALOR que indica que maneja esta modalidad\r\n				SI (@PRESENTVALOR) | (@PRESENTVALORP)\r\n					@presentismofac = 0\r\n					SI @PRESENTVALOR\r\n						@presentismo = @PRESENTVALOR\r\n						@presentismocant = 0\r\n					SINO\r\n						@present